import React from "react";
import bottle1 from "../../img/bottle1.png";
import logo from "../../img/logo1.png";
import "./List.css";

const items = [
  {
    id: 1,
    imageUrl1: logo,
    title1: "Product01",
    imageUrl2: bottle1,
    title2: "Item 2",
  },
  {
    id: 2,
    imageUrl1: logo,
    title1: "Product2",
    imageUrl2: bottle1,
    title2: "Item 2",
  },
  //...
];

function Item(props) {
  return (
    <div className="item">
      <img
        src={props.imageUrl1}
        alt={props.title1}
        style={{ width: "70px", height: "80px" }}
      />
      <h3>{props.title1}</h3>
      <img
        src={props.imageUrl2}
        alt={props.title2}
        style={{ width: "70px", height: "80px" }}
      />
    </div>
  );
}

function ListView(props) {
  return (
    <div className="list-view">
      {items.map((item) => (
        <Item
          key={item.id}
          imageUrl1={item.imageUrl1}
          title1={item.title1}
          imageUrl2={item.imageUrl2}
          title2={item.title2}
        />
      ))}
    </div>
  );
}

const List = () => {
  return (
    <div className="het">
      {" "}
      <ListView />
    </div>
  );
};

export default List;
